  point.prototype.update=function(){
    context3.beginPath();
    context3.fillStyle="#95a5a6";
    context3.arc(this.x,this.y,1,0,2*Math.PI);
    context3.fill();
    context3.closePath();
    if (this.x+this.vx>=context3.width||this.x+this.vx<0||mask.data[coordsToI(this.x+this.vx, this.y, mask.width)] != 255){
      this.vx*=-1;
      this.x+=this.vx*2;
    }
    if (this.y+this.vy>=context3.height||this.y+this.vy<0||mask.data[coordsToI(this.x, this.y+this.vy, mask.width)] != 255){
      this.vy*=-1;
      this.y+=this.vy*2;
    }
    for (var k=0, m=points.length; k<m; k++){
      if (points[k]===this) continue;
      var d=Math.sqrt(Math.pow(this.x-points[k].x,2)+Math.pow(this.y-points[k].y,2));
      if (d<5){
        context3.lineWidth=.2;
        context3.beginPath();
        context3.moveTo(this.x,this.y);
        context3.lineTo(points[k].x,points[k].y);
        context3.stroke();
      }
      if (d<20){
        context3.lineWidth=.1;
        context3.beginPath();
        context3.moveTo(this.x,this.y);
        context3.lineTo(points[k].x,points[k].y);
        context3.stroke();
      }
    }
    this.x+=this.vx;
    this.y+=this.vy;
  }

