  var Layer=function(nPower,preLayer){
    this.neurons=new Array(0);
    if(preLayer!=null){
      for(var i=0; i<nPower; i++){
        this.neurons.push(new Neuron(preLayer.neurons.length));
      }
    }else{
      for(var i=0; i<nPower; i++){
        this.neurons.push(new Neuron(0));
      }
    }
  }

  var Neuron=function(preLayerNeurons){
    this.variable=null;
    this.error=null;
    this.weights=new Array(0);
    for(var i=0;i<preLayerNeurons;i++){
      this.weights.push(new Weight(Math.sqrt(-2*Math.log(1-Math.random()))*Math.cos(2*Math.PI*Math.random())*Math.sqrt(2/preLayerNeurons)));
    }
    if(preLayerNeurons!=0){
      this.weights.push(new Weight(0));
    }
  }

  var Weight=function(coefficient){
    this.coefficient=coefficient;
    this.mean=0.0;
    this.variance=0.0;
  }

